import React from 'react';
import { Route } from 'react-router-dom';
import Home from './page/Home';
import ErrorPage from './page/ErrorPage';

function App() {
  return (
    <React.Fragment>
      <Route exact path="/" component={ Home } />
      <Route component={ ErrorPage } />
    </React.Fragment>
  );
}

export default App;
